INSERT INTO `ims_ewei_shop_goods` VALUES ('209', '1', '1174', '1177', '1', '0', '0', '荣威360', 'images/1/2017/11/KKZjscUSkKEousemekkb5CMZMZve3k.jpg', '', '', '<p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/CWw0zrXhQEQQHWfnnN2ZwRQXw025Fz.jpg\" width=\"100%\" alt=\"images/1/2017/11/CWw0zrXhQEQQHWfnnN2ZwRQXw025Fz.jpg\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">荣威360定位于高性价比国民车</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">荣威360是上汽在经过几款车型磨合之后推出的一款重磅车型，并且品牌命名上打破了荣威的命名规则，采用了荣威360作为新车名称，上汽也希望这款车像这个名字的寓意一样，做到360度面面均衡，成为国内一款高性价比国民车。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/tZTUrY2azZTv84vt8vvTtYTz4Us9T9.jpg\" width=\"100%\" alt=\"images/1/2017/11/tZTUrY2azZTv84vt8vvTtYTz4Us9T9.jpg\"/></p><div style=\"-webkit-tap-highlight-color: transparent; color: rgb(26, 26, 26); font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" font-size:=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\"><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; font-size: 16px; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px;\">富有亲和力的外观更受欢迎</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px;\">荣威360外观并没有太多花哨的设计，向两侧延展的线条使车头富有亲和力，这种简约风格虽不能带来强烈的视觉冲击力，但是受到备受中庸文化熏陶的国人喜欢。倒梯形进气格栅是荣威的家族化设计，在荣威360上已经表达的很成熟了。</div></div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/A1eexqv45eYMEQeEaMweXeMLQJ64V7.jpg\" width=\"100%\" alt=\"images/1/2017/11/A1eexqv45eYMEQeEaMweXeMLQJ64V7.jpg\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">仪表盘设计样式十分新颖</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">深浅搭配的配色加上横向延展的线条，荣威360的内饰看上去很舒服，造型设计在中国品牌中属于上乘水平。仪表盘采用了比较新颖的设计，中间时速表为传统指针模式，但是发动机转速表则改为了电子数字显示，仪表盘周围由蓝色光带包围，晚上的显示效果非常炫酷。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/D37aR2Xt33lA215JRQl41XwzWac2x6.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/y7zIfOGaLAjf73D54zo4JsG4O36j6g.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/McBhkspbBfQ333BkHOP00BQ3cKzk3k.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">丰富的储物空间充分满足家用</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">汽车现阶段是作为家庭除房子之外另外一个私密空间，家庭购车者甚至希望车内能具备除了睡觉以外所有的收纳空间。荣威360既然定位于新一代国民车，那么丰富的储物空间必不可少，后备箱接近500L的空间基本可以满足日常出行需要</div><p><br/></p>', '', '', '0.00', '2000.00', '0.00', '0.00', '30000.00', '5000', '36', '50000.00', '0.00', '36', '0.00', '0.00', '20000', '0', '200', '0', '', '1510108377', '0.00', '', '0', '0', '0', '0', 'a:2:{i:1;s:51:\"images/1/2017/11/M5z82XZ40CV1X1qUq6vq665u86qUkI.jpg\";i:2;s:51:\"images/1/2017/11/LL1k9ccKKZzl5CQokKI16lCKxLJ60J.jpg\";}', '1', '1', '0', '1', '1', '0', '0', '0', '0', '3', '0', '1', '0.00', '500.00', '0.00', '2000.00', '0.00', '1000.00', '0.00', '', '', '', '0', '', '', '0', '', '1', '', '', '', '', '1', '6,7,8', '', '0', '', '0', '', '', '0.00', '0', '1177', '{\"type\":\"0\",\"default\":\"\",\"default_pay\":\"\"}', '0', '0', '', '1181', '1177,1181', '0', '', '', '', '', '', '', '', '0', '0.00', '0', '0.00', '', '0', '0', '0', '0', '0', '0.00', '0', '2017款 荣威360 1.5L 自动智屏版', '', '1510108020', '{\"type\":0,\"default\":{\"option0\":\"\"}}', '{\"type\":0,\"default\":{\"option0\":[\"\",\"\",\"\"]},\"level3\":{\"option0\":[\"\",\"\",\"\"]},\"level4\":{\"option0\":[\"\",\"\",\"\"]},\"level5\":{\"option0\":[\"\",\"\",\"\"]}}', '0', '0', null, '0', '1', '1', '0', '', '2000.00', '2000.00', '请选择省份', '请选择城市', '0', '', '0', '0', '', '0', null, '0', '0', '1', '0', '0', '外观皓月白+内饰黑色/外观摩卡金+内饰黑色', '0', '0', null, '0', '0', '0', '1', '0', '荣威', '', '', '', '0', 'null', '0', '0', '0', '0', '0', '0.00', '0', '0', '0', null, '0', '0', '0', '0', '0', '0', '1510108020', '0', '0', '0.00');
INSERT INTO `ims_ewei_shop_goods` VALUES ('213', '1', '1174', '1177', '1', '0', '0', '本田雅阁', 'images/1/2017/11/d18x0MaUM0AdruMmUnIMD4y8R58D8F.jpg', '', '', '<p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/KP8II0FP73FC33iNini5HvvHK8ih3c.jpg\" width=\"100%\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">雅阁开启混合动力普及时代</div><p style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">雅阁作为国内中级车具有代表性的车型，曾数次进入国内销量年度前十，但是随着德系车“T动力”战略的整体发力，雅阁也开始走下坡路。不过好在，以雅阁为代表的日系车已经觉醒，开始全力引入混合动力车型来抗衡德系车的涡轮增压技术</p><p style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\"><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/ZsFfKbP93K5aB4scF3F4RpB4bs445B.jpg\" width=\"100%\" alt=\"images/1/2017/11/ZsFfKbP93K5aB4scF3F4RpB4bs445B.jpg\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">雅阁传承了本田一贯的稳重风格</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">雅阁混动外观设计上保持了本田一贯的稳重风格，与普通版雅阁在车身造型上并没有太大区别，只是为了凸显混动节能的特性，在中网、大灯的细节处理上，加入了一些蓝色装饰，来彰显混动身份</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/m955SRLTs2s330sd3205dp32D5d2fp.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/NbB7BpdTcF8bbB0J9fJ0FTVtFu03JC.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">雅阁车主点评：好开</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">如果让雅阁车主来用一个词点评雅阁，恐怕出现频率较高的会是“好开”。好开就是驾驶简单且高效，汽车大多数情况下只是我们的一个交通工具，没必要搞那么复杂的驾驶方式，雅阁混动更是将这种好开发扬光大，甚至将换挡杆都取消了，直接采用按键式换挡</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/Y0R0QylUh10pYR6yaAjbqa90p1jL3a.jpg\" width=\"100%\" alt=\"images/1/2017/11/Y0R0QylUh10pYR6yaAjbqa90p1jL3a.jpg\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">混合动力综合竞争力胜于涡轮增压</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">雅阁混动车型的综合百公里油耗基本在5升的水平，而同级别德系主力车型的油耗基本在八九升的样子，并且百公里加速水平也维持在8秒左右，基本和2.0T车型保持在同一个水平。最为关键的是，雅阁混动价格已经基本和同级别2.0T车型保持同步</div><p><br/></p>', '', '', '0.00', '1000.00', '0.00', '0.00', '125203.00', '3000', '36', '20000.00', '0.00', '36', '25252353.00', '3000.00', '250', '0', '5252', '0', '', '1510110977', '0.00', '', '0', '0', '0', '0', 'a:3:{i:1;s:51:\"images/1/2017/11/kM8am0Mayha7iM985767EaiEH7050Z.jpg\";i:2;s:51:\"images/1/2017/11/Jb3vnbTo3t2I33cE4NCKC43FOO8WNN.jpg\";i:3;s:51:\"images/1/2017/11/VgK6516soKZ6G61IIA6O1isQuq76GK.jpg\";}', '1', '1', '0', '1', '1', '0', '0', '0', '0', '2', '0', '1', '0.00', '500.00', '0.00', '2000.00', '0.00', '1000.00', '0.00', '', '', '', '0', '', '', '0', '', '1', '', '', '', '', '2', '6,7,8', '', '0', '', '0', '', '', '0.00', '0', '1177', '{\"type\":\"0\",\"default\":\"\",\"default_pay\":\"\"}', '0', '0', '', '1184', '1177,1184', '0', '', '', '', '', '', '', '', '0', '0.00', '0', '0.00', '', '0', '0', '0', '0', '0', '0.00', '0', '2016款 雅阁 混动 2.0L 锐酷版', '', '1510110660', '{\"type\":0,\"default\":{\"option0\":\"\"}}', '{\"type\":0,\"default\":{\"option0\":[\"\",\"\",\"\"]},\"level3\":{\"option0\":[\"\",\"\",\"\"]},\"level4\":{\"option0\":[\"\",\"\",\"\"]},\"level5\":{\"option0\":[\"\",\"\",\"\"]}}', '0', '0', null, '0', '1', '1', '0', '', '1000.00', '1000.00', '请选择省份', '请选择城市', '0', '', '0', '0', '', '0', null, '0', '0', '1', '0', '0', '外观奥夫特黑+内饰黑色', '0', '0', null, '0', '0', '0', '1', '0', '本田', '', '', '', '0', 'null', '0', '0', '0', '0', '0', '0.00', '0', '0', '0', null, '0', '0', '0', '0', '0', '0', '1510110660', '0', '0', '0.00');
INSERT INTO `ims_ewei_shop_goods` VALUES ('210', '1', '1174', '1177', '1', '0', '0', '荣威RX5', 'images/1/2017/11/E1JiUkC8WkodUDWz54oRI8U15uC8uQ.jpg', '', '', '<p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/MNEe48IY93h84I43W89i33II3zp9ep.jpg\" width=\"100%\" alt=\"images/1/2017/11/MNEe48IY93h84I43W89i33II3zp9ep.jpg\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/WjiMu2EBF1Bm4deO23bdJfbLijDEjB.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/FBcRCcc89WccR1RC1EC6j9q1C9w933.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/KstZUARBLAAjU7aYAz7KUAWlSdzlA9.jpg\" width=\"100%\" style=\"\"/></p><p style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">原创外观设计协调耐看</p><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">外观自不用说，荣威RX5在国产车当中算得上“一股清流”，体现着自己的原创设计，大灯融入了“C”形的LED日间行车灯，并且尾灯设计也十分惊艳，两者互相形成呼应，让整体造型比例更协调，十分耐看。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/DKk46JbtWWKNfwwSgy2K2ij5w51nWs.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/mREu4pNBCiIcNR9NCR6uunzI8FrNRT.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/MxxAXpAubbX55ZuqBQXmbZ6uUKb6qB.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/Od5id62l7t8Xt2FGh7dtCf8wCyn7wt.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">车内配置全面氛围豪华</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">中控面板采用了大面积缝线真皮和亚光金属饰板搭配，金属质感的空调旋钮手感特别棒，造型运动时尚的三幅真皮方向盘底部也装饰了银色饰板，握感十分舒适，配备了一键启动，主驾驶电动调节座椅，开口很大的全景天窗，8英寸中央大屏集成了导航，蓝牙和手机互联，整体配置还是很全面的。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/r4i25sN54I94aFlNAlS5wts49N5as9.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/MdSZQ8vNQa5cvqCDQR8R82nrUq82RA.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/BlxYUBYllDK8KZhKAUE9NYlUZ4bVbd.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">车内配置全面氛围豪华</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">中控面板采用了大面积缝线真皮和亚光金属饰板搭配，金属质感的空调旋钮手感特别棒，造型运动时尚的三幅真皮方向盘底部也装饰了银色饰板，握感十分舒适，配备了一键启动，主驾驶电动调节座椅，开口很大的全景天窗，8英寸中央大屏集成了导航，蓝牙和手机互联，整体配置还是很全面的。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/v26P0hhDvb62B36kKFd0K9E69jb7EB.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/Gu1aGf6RQqR1RlGI6g9GgpkUpk6Fwk.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/gu1DzP92DkuIUurVuVE9U2KRrSeVPe.jpg\" width=\"100%\" style=\"\"/></p><p><br/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">动力油耗</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">搭载了一台1.5T涡轮增压发动机，最大马力169Ps，最大扭矩250N·m，配备的是一台7速双离合变速箱，这台变速箱的调校不错，在低速行驶的拥堵路段也较少出现闯档的情况。底盘在高速时候表现非常稳健，对大颠簸的过滤处理的非常好，在低速时候也能给人清晰的路感。</div><p><br/></p>', '', '', '0.00', '2000.00', '0.00', '0.00', '250000.00', '8000', '36', '30000.00', '0.00', '36', '250000.00', '3000.00', '1023', '0', '120', '0', '', '1510108900', '0.00', '', '0', '0', '0', '0', 'a:3:{i:1;s:51:\"images/1/2017/11/A6A6queA4UkaEjaqJyE5ET6Z3zeq2y.jpg\";i:2;s:51:\"images/1/2017/11/Or3V0bnv0zcoIruU05U4nvIgV04gvb.jpg\";i:3;s:51:\"images/1/2017/11/H58I3I4mV4iBM4xIQ0xbez8824xqI4.jpg\";}', '1', '1', '0', '1', '1', '0', '0', '0', '0', '2', '0', '1', '0.00', '500.00', '0.00', '2000.00', '0.00', '1000.00', '0.00', '', '', '', '0', '', '', '0', '', '1', '', '', '', '', '2', '6,7,8', '', '0', '', '0', '', '', '0.00', '0', '1177', '{\"type\":\"0\",\"default\":\"\",\"default_pay\":\"\"}', '0', '0', '', '1181', '1177,1181', '0', '', '', '', '', '', '', '', '0', '0.00', '0', '0.00', '', '0', '0', '0', '0', '0', '0.00', '0', '2016款 荣威RX5 20T 两驱自动旗舰版', '', '1510108500', '{\"type\":0,\"default\":{\"option0\":\"\"}}', '{\"type\":0,\"default\":{\"option0\":[\"\",\"\",\"\"]},\"level3\":{\"option0\":[\"\",\"\",\"\"]},\"level4\":{\"option0\":[\"\",\"\",\"\"]},\"level5\":{\"option0\":[\"\",\"\",\"\"]}}', '0', '0', null, '0', '1', '1', '0', '', '2000.00', '2000.00', '请选择省份', '请选择城市', '0', '', '0', '0', '', '0', null, '0', '0', '1', '0', '0', '外观典雅白+内饰黑色', '0', '0', null, '0', '0', '0', '1', '0', '荣威', '', '', '', '0', 'null', '0', '0', '0', '0', '0', '0.00', '0', '0', '0', null, '0', '0', '0', '0', '0', '0', '1510108500', '0', '0', '0.00');
INSERT INTO `ims_ewei_shop_goods` VALUES ('211', '1', '1174', '1177', '1', '0', '0', '荣威550', 'images/1/2017/11/PHtvB8bHXvBC6Bhg7gtBTB00Z0786S.jpg', '', '', '<p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/c5fqi25U5ks5mhhCHHqqk5zukQSURo.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/oaI5mLCC8mT8oc5mMfmCMh58MhlOfT.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/yl44dY9oXVe92vp92DbOoA232l2331.jpg\" width=\"100%\" style=\"\"/></p><p><span style=\"color: rgb(51, 51, 51); font-family: 宋体, arial, tahoma, sans-serif; background-color: rgb(255, 255, 255);\">&nbsp;荣威550的车身尺寸4624×1827×1480mm（长×宽×高）比较突出，其中长度要比福克斯、速腾都要大，而轴距更是领先对手100多毫米（达到2705mm），为此车内的空间也必然会有更好的延伸空间。</span></p><p><span style=\"color: rgb(51, 51, 51); font-family: 宋体, arial, tahoma, sans-serif; background-color: rgb(255, 255, 255);\"></span></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/qIi9V4ZaaA04tVVgu9aZ3T45V9KVTN.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/qiDLL30D2WoRIpdHPPS0G0POiPwW0o.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/uQXrSsR6hhsyW1ncjR7sSsn7r176n6.jpg\" width=\"100%\" style=\"\"/></p><p><span style=\"color: rgb(51, 51, 51); font-family: 宋体, arial, tahoma, sans-serif; background-color: rgb(255, 255, 255);\"><br/></span><span style=\"color: rgb(51, 51, 51); font-family: 宋体, arial, tahoma, sans-serif; background-color: rgb(255, 255, 255);\">多功能显示屏也称得上是内饰中的一大特色，除了外部的视觉效果好之外，功能方面也很是丰富：温度、日期、蓝牙通讯链接、指南针等等一样也不少！除此之外，它还具有DVD播放与倒车影像功能！该屏幕设计在仪表盘的右侧，并与之共存在一个中控台整体中，这个部分仿佛又有些宝马的影子，但不管怎样，荣威的这个全新设计还是会赢得更多的喝彩。</span></p><p><span style=\"color: rgb(51, 51, 51); font-family: 宋体, arial, tahoma, sans-serif; background-color: rgb(255, 255, 255);\"></span></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/z7upD0MU09C0M7Ca0rfoFa0M01cREt.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/z4dr41u69q66g4igpk9zPq0QMDfWG3.jpg\" width=\"100%\" style=\"\"/></p><p><span style=\"color: rgb(51, 51, 51); font-family: 宋体, arial, tahoma, sans-serif; background-color: rgb(255, 255, 255);\"><br/></span><span style=\"color: rgb(51, 51, 51); font-family: 宋体, arial, tahoma, sans-serif; background-color: rgb(255, 255, 255);\">Nappa真皮座椅质感很不错，细密的针脚和缝线看得出来确实成本不低，整体质感甚至强于大多数同价位的合资品牌。座椅填充物则属于偏硬朗的类型，包裹性一般，舒适性还不错。尽管质感很棒，但前后排座椅却在人机工程设计上存在着一些小小的不足。</span></p><p><span style=\"color: rgb(51, 51, 51); font-family: 宋体, arial, tahoma, sans-serif; background-color: rgb(255, 255, 255);\"><br/></span></p><p><span style=\"color: rgb(51, 51, 51); font-family: 宋体, arial, tahoma, sans-serif; background-color: rgb(255, 255, 255);\"><br/></span></p>', '', '', '0.00', '24000.00', '0.00', '0.00', '240000.00', '5000', '36', '40000.00', '0.00', '6', '240000.00', '3000.00', '202', '0', '23', '0', '', '1510109822', '0.00', '', '0', '0', '0', '0', 'a:3:{i:1;s:51:\"images/1/2017/11/N041fv4LX1ymNf41mYF6VM15402Uq9.jpg\";i:2;s:51:\"images/1/2017/11/rTCJmobcOijTcyITM45MPJ1yNEnm5O.jpg\";i:3;s:51:\"images/1/2017/11/JSf2sQjQ2LGH8jZCc97gf0SeDq5hOS.jpg\";}', '1', '1', '0', '1', '1', '0', '0', '0', '0', '2', '0', '1', '0.00', '500.00', '0.00', '2000.00', '0.00', '1000.00', '0.00', '', '', '', '0', '', '', '0', '', '1', '', '', '', '', '2', '6,7,8', '', '0', '', '0', '', '', '0.00', '0', '1177', '{\"type\":\"0\",\"default\":\"\",\"default_pay\":\"\"}', '0', '0', '', '1181', '1177,1181', '0', '', '', '', '', '', '', '', '0', '0.00', '0', '0.00', '', '0', '0', '0', '0', '0', '0.00', '0', '2013款 550G 1.8T 自动品仕版', '', '1510109280', '{\"type\":0,\"default\":{\"option0\":\"\"}}', '{\"type\":0,\"default\":{\"option0\":[\"\",\"\",\"\"]},\"level3\":{\"option0\":[\"\",\"\",\"\"]},\"level4\":{\"option0\":[\"\",\"\",\"\"]},\"level5\":{\"option0\":[\"\",\"\",\"\"]}}', '0', '0', null, '0', '1', '1', '0', '', '24000.00',