INSERT INTO `ims_ewei_shop_goods` VALUES ('212', '1', '1174', '1177', '1', '0', '0', '本田雅阁', 'images/1/2017/11/wM9mTQ49GqM4ZoE91x8H2422491Z1m.jpg', '', '', '<p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/gpoOybuClRZ5i3Xf25uB1VUOg19rXg.jpg\" width=\"789\" alt=\"images/1/2017/11/gpoOybuClRZ5i3Xf25uB1VUOg19rXg.jpg\" height=\"525\" style=\"width: 789px; height: 525px;\"/></p><p style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\"><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/S6h3JMKm6r9Jr5K47J664AS97rzKZ6.jpg\" width=\"100%\" alt=\"images/1/2017/11/S6h3JMKm6r9Jr5K47J664AS97rzKZ6.jpg\"/></p><p style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">雅阁是一款很有“历史”的车型</p><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">雅阁在中国算是一款很有“历史”的车型，从最早第六代国产，到如今2016款新车，已经是第九代车型。国产十八年来，累计销售超过150万辆，较高的保有量带来最直接的好处就是二手车保值率高，同时维修方便、配件便宜。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/e4tq2QQ9374nqU49Zy20RU88948t0Q.jpg\" width=\"100%\" alt=\"images/1/2017/11/e4tq2QQ9374nqU49Zy20RU88948t0Q.jpg\"/></p><p style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\"><br/></p><p style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">雅阁传承了本田一贯的稳重风格</p><p style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">2016款雅阁外观设计上保持了本田一贯的稳重风格，同时加大了镀铬材质在中网的运用，细长明亮的镀铬条配合圆形雾灯，使得整车头部看起来很有神。</p><p style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\"><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/SmFQOfnsoVuqd6uF1odOSbd61dX66U.jpg\" width=\"100%\" alt=\"images/1/2017/11/SmFQOfnsoVuqd6uF1odOSbd61dX66U.jpg\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/nxy79Y77IW98X97VWHR5y505YI87g7.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/L3T3C3qqIqftquTV33tGiRtOt7Qu5U.jpg\" width=\"100%\" style=\"\"/></p><p style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">雅阁车主点评：好开</p><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">如果让雅阁车主来用一个词点评雅阁，恐怕出现频率较高的会是“好开”。好开就是驾驶简单且高效，汽车大多数情况下只是我们的一个交通工具，没必要搞那么复杂的驾驶方式，2016款雅阁标配的“电子刹车+自动驻车”就进一步将这种“好开”发扬光大。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/H7EC7cZnZOsWZKvv7cYSoyQyEX77kV.jpg\" width=\"100%\" alt=\"images/1/2017/11/H7EC7cZnZOsWZKvv7cYSoyQyEX77kV.jpg\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">搭载更佳平稳的CVT变速箱</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">2016款雅阁的“好开”还体现在另外一个改变上，那就是CVT变速箱的运用，CVT变速箱的特点就是“柔顺”，同时体现在车辆驾驶上就是更加平稳。对于一款雅阁这样“公私兼备”的车型来说，行驶的稳定性远远比百公里加速提高1秒来的更为实在。</div><p><br/></p>', '', '', '0.00', '1200.00', '0.00', '0.00', '120000.00', '1000', '36', '50000.00', '1000.00', '36', '150000.00', '3000.00', '2019', '0', '202', '0', '', '1510110514', '0.00', '', '0', '0', '0', '0', 'a:2:{i:1;s:51:\"images/1/2017/11/M1mfRiEp8Fapz6ymrF7cB7mie8fpfC.jpg\";i:2;s:51:\"images/1/2017/11/RcC75dYRCDgr9vbXg9z5SgyzR0bvYS.jpg\";}', '1', '1', '0', '1', '1', '0', '0', '0', '0', '16', '0', '1', '0.00', '500.00', '0.00', '2000.00', '0.00', '1000.00', '0.00', '', '', '', '0', '', '', '0', '', '1', '', '', '', '', '2', '6,7,8', '', '0', '', '0', '', '', '0.00', '0', '1177', '{\"type\":\"0\",\"default\":\"\",\"default_pay\":\"\"}', '0', '0', '', '1184', '1177,1184', '0', '', '', '', '', '', '', '', '0', '0.00', '0', '0.00', '', '0', '0', '0', '0', '0', '0.00', '0', '2016款 雅阁 2.0L 舒适版', '', '1510109880', '{\"type\":0,\"default\":{\"option0\":\"\"}}', '{\"type\":0,\"default\":{\"option0\":[\"\",\"\",\"\"]},\"level3\":{\"option0\":[\"\",\"\",\"\"]},\"level4\":{\"option0\":[\"\",\"\",\"\"]},\"level5\":{\"option0\":[\"\",\"\",\"\"]}}', '0', '0', null, '0', '1', '1', '0', '', '1200.00', '1200.00', '请选择省份', '请选择城市', '0', '', '0', '0', '', '0', null, '0', '0', '1', '0', '0', '外观奥夫特黑+内饰黑色', '0', '0', null, '0', '0', '0', '1', '0', '本田', '', '', '', '0', 'null', '0', '0', '0', '0', '0', '0.00', '0', '0', '0', null, '0', '0', '0', '0', '0', '0', '1510109880', '0', '0', '0.00');
INSERT INTO `ims_ewei_shop_goods` VALUES ('216', '1', '1174', '1177', '1', '0', '0', '本田奥德赛', 'images/1/2017/11/syUkyqamE5Md7KkhYtTaU6EHhTNuyh.jpg', '', '', '<p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/vT9TDn9Tz6TEm0ZRM9qvhpP0zhnmN2.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/IoBlmjxxT0mRZ0LxzbJo12l2RMLjxU.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/Y6SJJpg6lLNspj6PLgbpjPgdjp6jXp.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">奥德赛是一款满足家用的商务车</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">选择奥德赛的人总喜欢拿别克GL8来做一番对比，其实二者压根就没有太多对比性，从驾驶者的身份就可以完全区分开来，GL8的驾驶者一定是专业司机，而奥德赛的驾驶者有可能是家庭男女主人，或者是公司同事。所以说，奥德赛是一款在满足家用的商务车。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/PEe016zme6CcdeE0DNu81dxu1NnG11.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">奥德赛配备非常实用的电动侧滑门</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">全新奥德赛自2015年换代非常成功，从一款非主流MPV造型摇身一变成为一款标准的四四方方MPV造型，采用商务MPV必备的电动侧滑门，方便后排乘客的上下车。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/n28tSXAooQyT8ImzqtA2HH5rAS5yIS.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/zZngpX1XqqqQqX1HHMkh2JMJO2rNqH.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">采用2+2+3标准MPV座椅布局</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">全新奥德赛开始为后排乘客考虑更多便利性，采用的2+2+3的座椅布局，既保证了第二排乘客的独立性也方便了第三排乘客的进出，更加符合商务MPV的定位</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/JXNKxEb1R22TZ12e2cwtN2cuEc2iW5.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/lT0Oh0mt4v8o0sAa0Sw0WRwvwEA8Ga.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/pCqt7bHYK86KkHtKHCKtpqqwtdZYQ0.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">本田成熟的动力搭配：2.4L+CVT</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">全新奥德赛搭载搭载本田先进的Earth Dreams Technology（地球梦科技）动力总成系统，配备CVT无级变速箱及Idle-stop发动机节能自动启停系统，实现了综合工况油耗低至7.8L/100km。</div><p><br/></p>', '', '', '0.00', '2000.00', '0.00', '0.00', '20000.00', '2000', '36', '2000.00', '2000.00', '36', '20000.00', '3000.00', '205', '0', '5254', '0', '', '1510112011', '0.00', '', '0', '0', '0', '0', 'a:3:{i:1;s:51:\"images/1/2017/11/b2rWGgDjhDj2vM6g2hz77Zr29RE7e3.jpg\";i:2;s:51:\"images/1/2017/11/j0G2z7KGCeEgyTlehlb7kfGBcFFh80.jpg\";i:3;s:51:\"images/1/2017/11/jBRBl1180t1qgG37uB97mqgu97cbBT.jpg\";}', '1', '1', '0', '1', '1', '0', '0', '0', '0', '4', '0', '1', '0.00', '500.00', '0.00', '2000.00', '0.00', '1000.00', '0.00', '', '', '', '0', '', '', '0', '', '1', '', '', '', '', '2', '6,7,8', '', '0', '', '0', '', '', '0.00', '0', '1177', '{\"type\":\"0\",\"default\":\"\",\"default_pay\":\"\"}', '0', '0', '', '1184', '1177,1184', '0', '', '', '', '', '', '', '', '0', '0.00', '0', '0.00', '', '0', '0', '0', '0', '0', '0.00', '0', '2017款 奥德赛 2.4L 豪华版', '', '1510111740', '{\"type\":0,\"default\":{\"option0\":\"\"}}', '{\"type\":0,\"default\":{\"option0\":[\"\",\"\",\"\"]},\"level3\":{\"option0\":[\"\",\"\",\"\"]},\"level4\":{\"option0\":[\"\",\"\",\"\"]},\"level5\":{\"option0\":[\"\",\"\",\"\"]}}', '0', '0', null, '0', '1', '1', '0', '', '2000.00', '2000.00', '请选择省份', '请选择城市', '0', '', '0', '0', '', '0', null, '0', '0', '1', '0', '0', '外观珍珠白+内饰浅色', '0', '0', null, '0', '0', '0', '1', '0', '本田', '', '', '', '0', 'null', '0', '0', '0', '0', '0', '0.00', '0', '0', '0', null, '0', '0', '0', '0', '0', '0', '1510111740', '0', '0', '0.00');
INSERT INTO `ims_ewei_shop_goods` VALUES ('214', '1', '1174', '1177', '1', '0', '0', '本田锋范', 'images/1/2017/11/WSWYQhM7Q5SW709w99BG5SL7SQ2699.jpg', '', '', '<p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/Ek1F91g74P46181Y7kgg7744r7LrCg.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/rOu2Anm2NnvoXGftsKsU5aOanQNmQF.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/Y83y61bLiS7owg7sLSNf1O86NLVG3o.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">全球化外观年轻犀利</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">全新锋范采用型格流线设计，没有平凡的相貌，只有无法聚焦的装扮，用视觉感知MODE，是型格创造焦点。全新中网造型采用深灰色配色，型之有范，是在对华丽的盲目崇拜中，保持冷静的自我风格，是一种自然流露的率性，是一种值得鉴赏的品味，是用毫无掩饰的自我，重新诠释生活，把城市变成自我的舞台。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/FO61q1Pn5DuWqUyrdnNwL5U6u1QLdd.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/X7O71iN0Exb90kkfUj71fhhieHeu0K.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">未来主义的航空驾驶舱</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">T型一体化中控设计，流畅的线条诠释出未来座舱的科技美感，层次分明的型格设计让行车信息一目了然。平滑流线式高质感内装，柔软而富有弹性的软包垫材质，并以手工质地的车缝线缝缀拼接。显著提升内饰档次的同时，创造出柔滑的驾乘触感。中控可以自己加装音响主机，原厂已经预留了接口和喇叭。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/p6e6Iv5ZVQZbr5rTvuL7bmFbBVeJre.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">增长轴距造就奢侈车内空间</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">锋范全新设计的车身相比上一代在轴距上增长50mm，后排坐垫增加的后排空间可以舒适乘坐三个成年人，后排地板平整，中间乘客不需要将就，即使和大一号的B级车相比，空间也不会成为短板。后备箱容积536L，在同级车型中处于领先位置。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/KnnG9I0DX199rr019cGx9tzggWw91D.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/F03f09fEgpPpfpwPnC7gbcGxc7GbpG.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/bux3OVcxG5CuvoxpG5wzrxc02V7lVH.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">搭载本田全新地球梦科技动力</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">全新锋范采用本田“地球梦科技”1.5L i-VTEC电控燃油缸内直喷发动机，强劲的发动机为锋范提供源源不断的动力，最大功率131匹。保持高动力输出的同时，CVT变速箱为省油做出了贡献，百公里综合燃油消耗仅5.4L。真正实现了1.3L的油耗，1.8L的动力。</div><p><br/></p>', '', '', '0.00', '1000.00', '0.00', '0.00', '100000.00', '10000', '36', '20000.00', '0.00', '36', '2530525.00', '3000.00', '233', '0', '523253', '0', '', '1510111266', '0.00', '', '0', '0', '0', '0', 'a:4:{i:1;s:51:\"images/1/2017/11/cX9Tl6D29cQDvBV2b2svQc22k9Vv7v.jpg\";i:2;s:51:\"images/1/2017/11/W9G515cgDy0KY4924G1G9G8uGGR5du.jpg\";i:3;s:51:\"images/1/2017/11/y5udGT6655q78I6IL3zT3uF3ii3GGu.jpg\";i:4;s:51:\"images/1/2017/11/S9Kd30mjOMON39dpbpkPj09W4cJmp4.jpg\";}', '1', '1', '0', '1', '1', '0', '0', '0', '0', '3', '0', '1', '0.00', '500.00', '0.00', '2000.00', '0.00', '1000.00', '0.00', '', '', '', '0', '', '', '0', '', '1', '', '', '', '', '2', '6,7,8', '', '0', '', '0', '', '', '0.00', '0', '1177', '{\"type\":\"0\",\"default\":\"\",\"default_pay\":\"\"}', '0', '0', '', '1184', '1177,1184', '0', '', '', '', '', '', '', '', '0', '0.00', '0', '0.00', '', '0', '0', '0', '0', '0', '0.00', '0', '2017款 锋范 1.5L CVT舒适版', '', '1510111020', '{\"type\":0,\"default\":{\"option0\":\"\"}}', '{\"type\":0,\"default\":{\"option0\":[\"\",\"\",\"\"]},\"level3\":{\"option0\":[\"\",\"\",\"\"]},\"level4\":{\"option0\":[\"\",\"\",\"\"]},\"level5\":{\"option0\":[\"\",\"\",\"\"]}}', '0', '0', null, '0', '1', '1', '0', '', '1000.00', '1000.00', '请选择省份', '请选择城市', '0', '', '0', '0', '', '0', null, '0', '0', '1', '0', '0', '外观塔夫绸白+内饰淡黄', '0', '0', null, '0', '0', '0', '1', '0', '本田', '', '', '', '0', 'null', '0', '0', '0', '0', '0', '0.00', '0', '0', '0', null, '0', '0', '0', '0', '0', '0', '1510111020', '0', '0', '0.00');
INSERT INTO `ims_ewei_shop_goods` VALUES ('215', '1', '1174', '1177', '1', '0', '0', '本田凌派', 'images/1/2017/11/P5L5dIQDRcC1M55XD4QXS5dmL15Mz5.jpg', '', '', '<p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/fZxP64jASbbp80Z6P9R2D46Z9g6j5b.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/ipoBOv85a3PCoHvA3AO5bHgb5ALmPh.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">设计灵感来源于中国建筑</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">凌派的外观设计灵感来自于中国建筑，所以自然是霸气威武的。中期改款以后中网的面积有所增大，还配上了大面积的镀铬装饰条。大灯组在原有的基础上增加了LED日间行车灯的配置，它很容易就让您成为车流中闪亮的星。车身上的线条也有所增加，特别是腰线处的线条，让整辆车的力量感倍增，轮毂也采用了时下流行的刀锋式熏黑轮毂。所以凌派作为一辆家用车，它的颜值肯定不会给您拖后腿。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/aVEl83y44FkG3oZxX88SBKO8QXYvbf.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/e6zGjfTuTfl5plGt7gxxll2J7lgl83.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/Dqo51G1O57yVVnGg7tNftoyCzvF71T.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">继承了本田“空间魔术师”的美誉</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">凌派是本田工程师根据中国消费者的需求量身打造的，所以它的空间自然是最重要的。凌派的车身尺寸达到了4664/1750/1505mm，数字看起来好像并不那么惊艳，但是本田的用心良苦您是想象不到的。实际体验下来，坐5个人一点也不拥挤，甚至还有些空余，作为一辆紧凑级轿车，有这样的表现就够了。同时，它的储物空间也是非常丰富的，基本上平时手上拿着的像手机、钱包、钥匙等物品，随手就有位置放。此外它还设计有很多小机关，比如中控台及后排座椅下方的隐藏式的储物格。所以，它的空间您就不需要担心了。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/Wkl9GG88Wz8ggE9QXj9G4ZF8lsxg42.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/PqUNQ9hPNlYpp2DHQ59lugIznlh5bT.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">驾驶感受以舒适家用为主</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">凌派开起来可能就没有外观看着那么动感了，毕竟舒适才是它的首要使命。1.8L的自然吸气发动机，最大功率为136马力（100Kw），最大扭矩为169N·m，参数并不算大，但它的油门调教的比较灵敏，在日常驾驶过程中不会感觉到动力不够用，速度在100Km/h之内都能为您提供不错的加速。转向嘛，属于那种不重也不轻的居家风格。悬挂调校的也是舒适取向，比较柔软。总之，这是一辆无论是开起来还是坐起来都非常适合家用的车。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/YsfsPXzJsf8XX7ihSaFH0G7hixiJG9.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/k4f41tJGZJ4Qfe4zt38J8t3IYxFP8J.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">燃油经济性突出</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">凌派搭载了一台代号为R18ZH的1.8L自然吸气发动机，拥有可变气门正时技术，它就是为了省油而被发明的。同时新款车型上换装了一台CVT变速箱，同样也是以省油和平顺性著称的。此外，在自动挡车型上都配备了Econ节能模式，按钮被设计成了绿色，上面还很形象地画着小树叶，并且它的位置也很显眼，是不是很想按下去呢？没错，凌派就是一个好开、空间大又省油的居家小能手。</div><p><br/></p>', '', '', '253253.00', '1000.00', '0.00', '0.00', '522530.00', '5252', '36', '25353.00', '2125.00', '36', '522530.00', '3000.00', '2505', '0', '232', '0', '', '1510111542', '0.00', '', '0', '0', '0', '0', 'a:3:{i:1;s:51:\"images/1/2017/11/iA3syYViYs3v335sS51iSjayy58434.jpg\";i:2;s:51:\"images/1/2017/11/CEyeZ5IJoFyFYMhf7yoENO5f5oFLKb.jpg\";i:3;s:51:\"images/1/2017/11/Y56vRivcSddRjc4rr7cj7I4E4V76WV.jpg\";}', '1', '1', '0', '1', '1', '0', '0', '0', '0', '5', '0', '1', '0.00', '500.00', '0.00', '2000.00', '0.00', '1000.00', '0.00', '', '', '', '0', '', '', '0', '', '1', '', '', '', '', '2', '6,7,8', '', '0', '', '0', '', '', '0.00', '0', '1177', '{\"type\":\"0\",\"default\":\"\",\"default_pay\":\"\"}', '0', '0', '', '1184', '1177,1184', '0', '', '', '', '', '', '', '', '0', '0.00', '0', '0.00', '', '0', '0', '0', '0', '0', '0.00', '0', '2017款 凌派 1.8L CVT舒适版', '', '1510111260', '{\"type\":0,\"default\":{\"option0\":\"\"}}', '{\"type\":0,\"default\":{\"option0\":[\"\",\"\",\"\"]},\"level3\":{\"option0\":[\"\",\"\",\"\"]},\"level4\":{\"option0\":[\"\",\"\",\"\"]},\"level5\":{\"option0\":[\"\",\"\",\"\"]}}', '0', '0', null, '0', '1', '1', '0', '', '1000.00', '1000.00', '请选择省份', '请选择城市', '0', '', '0', '0', '', '0', null, '0', '0', '1', '0', '0', '外观塔夫绸白+内饰黑色', '0', '0', null, '0', '0', '0', '1', '0', '本田', '', '', '', '0', 'null', '0', '0', '0', '0', '0', '0.00', '0', '0', '0', null, '0', '0', '0', '0', '0', '0', '1510111260', '0', '0', '0.00');
INSERT INTO `ims_ewei_shop_goods` VALUES ('217', '1', '1174', '1177', '1', '0', '0', '标致508', 'images/1/2017/11/KAM6BRmUAjuJ7Pu6pPBSSMupspUApu.jpg', '', '', '<p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/Z36c6AvLYajJdYzNnK63HY3Z4VK1D3.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/CxMMHm0J272WgQGX2AlNQozn9k7X01.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/sL545kxyJgO5KBjd9JNoyDo45IL5Z4.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">搭载性能优秀引擎的标致508</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">标致508作为标致的旗舰车型，在技术应用上也达到了标致汽车较高水平，无论是制造工艺、动力配备以及内饰水准都在同级车中树立了标杆。尤其搭载的1.6T引擎，作为与BMW共同研发的结晶，在动力和能耗控制都已经达到了同排量发动机难以企及的水平。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/yfK6quqUWj6EKj4q4aO8C6aQMOQwkz.jpg\" width=\"100%\" alt=\"images/1/2017/11/yfK6quqUWj6EKj4q4aO8C6aQMOQwkz.jpg\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">辨识度高的狮爪式尾灯</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">标致508外观设计上更加注重科技的运用，狮爪式尾灯采用光带式光源来模拟狮爪造型，在晚上打开尾灯后有着很高的识别度。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/IgCs5z5555o1c671741N5Um4OddZ5F.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/k1VbRoYZeynQ1z5msfQb5F5Z55QNr1.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/S83rR688O2XRRa8868F6120rxacR6L.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">更实用的双区自动空调带</div><p style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">标致508内饰采用纯黑内饰，提升了车辆整体的运动感和豪华感，采用的双区恒温自动空调也是同级车中少有的配置，在炎炎夏日和冰冷寒冬能给车内乘客更加适宜的温度。</p><p style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\"><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/tGk909pC7apSwLDyzpdZLWZsnpMnCG.jpg\" width=\"100%\" alt=\"images/1/2017/11/tGk909pC7apSwLDyzpdZLWZsnpMnCG.jpg\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/Swaa0fkguK321QkQ12CW70c2333kcq.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/wGRRGNE9mFV1MN95m6mGn79KkAAGVe.jpg\" width=\"100%\" style=\"\"/></p><p><br/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">同级别弯道表现优异车型</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">标致508最大的特点就是动态驾驶的稳定性，标致汽车一直都有“弯道之王”的别称，在标致508上，这种“弯道之王”有了更佳深入的理解，那就是不单单追求过弯速度和侧倾度，还十分注重车内驾乘人员的整体舒适度。</div><p><br/></p>', '', '', '0.00', '252020.00', '0.00', '0.00', '200000.00', '2000', '36', '80000.00', '0.00', '36', '252020.00', '3000.00', '2000', '0', '520', '0', '', '1510115893', '0.00', '', '0', '0', '0', '0', 'a:3:{i:1;s:51:\"images/1/2017/11/UgSZgkYEgKMguWG6zU2kccsZug83MS.jpg\";i:2;s:51:\"images/1/2017/11/yuCU2Ho9jZuooqoLjljld2Q3J7JQU8.jpg\";i:3;s:51:\"images/1/2017/11/TTaG9Hz3Ad93Y93P81RZYgAaZWyGH9.jpg\";}', '1', '1', '0', '1', '1', '0', '0', '0', '0', '1', '0', '1', '0.00', '500.00', '0.00', '2000.00', '0.00', '1000.00', '0.00', '', '', '', '0', '', '', '0', '', '1', '', '', '', '', '2', '6,7,8', '', '0', '', '0', '', '', '0.00', '0', '1177', '{\"type\":\"0\",\"default\":\"\",\"default_pay\":\"\"}', '0', '0', '', '1185', '1177,1185', '0', '', '', '', '', '', '', '', '0', '0.00', '0', '0.00', '', '0', '0', '0', '0', '0', '0.00', '0', '2015款 标致508 1.6THP 自动致逸天窗版', '', '1510114140', '{\"type\":0,\"default\":{\"option0\":\"\"}}', '{\"type\":0,\"default\":{\"option0\":[\"\",\"\",\"\"]},\"level3\":{\"option0\":[\"\",\"\",\"\"]},\"level4\":{\"option0\":[\"\",\"\",\"\"]},\"level5\":{\"option0\":[\"\",\"\",\"\"]}}', '0', '0', null, '0', '1', '1', '0', '', '252020.00', '252020.00', '请选择省份', '请选择城市', '0', '', '0', '0', '', '0', null, '0', '0', '1', '0', '0', '外观珠光白+内饰黑色/外观松木棕+内饰黑色', '0', '0', null, '0', '0', '0', '1', '0', '', '', '', '', '0', 'null', '0', '0', '0', '0', '0', '0.00', '0', '0', '0', null, '0', '0', '0', '0', '0', '0', '1510114140', '0', '0', '0.00');
INSERT INTO `ims_ewei_shop_goods` VALUES ('218', '1', '1174', '1177', '1', '0', '0', '标致408', 'images/1/2017/11/MMqlmpDhNTm7mmGEJkJNVfMNoNzJSg.jpg', '', '', '<p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/l3sK3HZDdh7SL8EGl7L7GXdhv8E7Vf.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/z75L142Rw1glgNglO3lwZ1jzG5eqMP.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">标致专为中国人设计的第一款车</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">408在外观上已经完全遵循了标致品牌的家族化设计，狮眼／狮爪式前后大灯让标致408看起来十分有神，同时长轴距车身也完全照顾了国内喜好大空间的客户。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/nmoOq3mAOO1TyqiQIFqPowyWZlBSJc.jpg\" width=\"100%\" alt=\"images/1/2017/11/nmoOq3mAOO1TyqiQIFqPowyWZlBSJc.jpg\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">车身外观设计全面尊循标致家族基因</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">标致的品牌就是一头咆哮的狮子，所以在这一代标致品牌车型设计上，将狮眼／狮爪式前后大灯作为标致品牌的家族特征固定下来。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/U47Dnh9KvmxhNFnmaGhNDL3fw57Ndz.jpg\" width=\"100%\" style=\"\"/></p><p><br/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/A64Dzm76q2627e2IbNiqAbN4P241GM.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">极简风格中控台+超有质感的内饰覆盖材质</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">标致408内饰的整体质感在同级车中表现优秀，中控台上覆盖的全软质橡胶材质摸上去手感超棒，采用简约设计风格的中控台，除了一个音量旋钮，几乎看不到多余的按键。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/usG7tt0yEl5NYTqg7F5RsFy0g77RGR.jpg\" width=\"100%\" alt=\"images/1/2017/11/usG7tt0yEl5NYTqg7F5RsFy0g77RGR.jpg\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">优秀高效的动力系统</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">第二代标致408采用1.8升自然吸气发动机搭配6挡手自一体变速箱，最大功率139匹马力，百公里综合油耗仅5.7升，达到了动力油耗均衡发展。</div><p><br/></p>', '', '', '0.00', '10000.00', '0.00', '0.00', '52000.00', '2000', '36', '80000.00', '1000.00', '36', '342000.00', '3000.00', '200', '0', '2', '0', '', '1510116295', '0.00', '', '0', '0', '0', '0', 'a:3:{i:1;s:51:\"images/1/2017/11/TD8E5XD1xBBmL91GgBerL8Rlxm35Ze.jpg\";i:2;s:51:\"images/1/2017/11/zdYS52BsyNsNXDx52NPLP7YAN5Dgjp.jpg\";i:3