INSERT INTO `ims_ewei_shop_goods` VALUES ('219', '1', '1174', '1177', '1', '0', '0', '标致2008', 'images/1/2017/11/JArb0hfrRQ2n332qg66Lff2fRn33Q2.jpg', '', '', '<p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/WZTTy44F4mQnhFMUu4HuM5uNEDT4h0.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/tGKFAWpnAEEZyFff45g5wfzfk28U24.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/H802m1DJfK80joNCFxfZdFJN8024CJ.jpg\" width=\"100%\" style=\"\"/></p><div style=\"-webkit-tap-highlight-color: transparent; color: rgb(26, 26, 26); font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" font-size:=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\"><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; font-size: 16px; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px;\">年轻人体现自我个性的随心座驾</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px;\">标致2008是标致汽车专为追求个性自我的年轻人推出的一款城市SUV，整车车身尺寸不超过4.2米，这与目前追求高大威猛的SUV设计风潮有着完全迥异的风格，这款车更像是年轻人追求个性的大玩具，外观设计也以时尚动感为主。</div></div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/dXZdbjpPiihFBx2InXf1xBX1115nNB.jpg\" width=\"100%\" alt=\"images/1/2017/11/dXZdbjpPiihFBx2InXf1xBX1115nNB.jpg\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">价格不再高不可攀 车身不再一成不变</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">标致2008外观主打时尚、轻盈、运动的设计理念，这也非常符合目前年轻人的购车心态，汽车不再是一件一成不变的奢侈品，而只是一个可以“随心所欲”购买的消费品。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/C26a10NDWtW2ndBh6d06ahQd9p77TW.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/R8Htv8GMhf4H5jiQuHuvOGRJZJUhgH.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/I5FT57PL2P5FBM9jXNo62Q99t65yxj.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">内饰设计简洁时尚</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">标致2008的内饰从设计，到做工用料，再到配置，在小型车或者小型SUV里都算得上非常出色的。方向盘的尺寸比较小，并且是那种上下比较扁的造型，看起来很像是性能车的方向盘。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/UeoIEexzo1nuUEEdziePk1DINOy7Pz.jpg\" width=\"100%\" alt=\"images/1/2017/11/UeoIEexzo1nuUEEdziePk1DINOy7Pz.jpg\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">动力系统省油高效</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">标致2008搭载的是一台1.6L自然吸气发动机，带有CVVT技术。最大功率117马力（86千瓦），最大扭矩150牛·米。与1.6L发动机匹配的是一台四速手自一体变速箱。</div><p><br/></p>', '',