INSERT INTO `ims_ewei_shop_goods` VALUES ('223', '1', '1174', '1177', '1', '0', '0', '标致RCZ', 'images/1/2017/11/IE8Bls8GTyFTGtgteERtSJyTyTLJkX.jpg', '', '', '<p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/eUBOy5MUu5233r3UU8FRpTm0A3ruU3.jpg\" width=\"100%\" alt=\"images/1/2017/11/eUBOy5MUu5233r3UU8FRpTm0A3ruU3.jpg\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">法式浪漫典型的代表作</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">法式浪漫一直都是汽车设计界的一个风向标，而在国内，标致RCZ则是法系浪漫的典型代表，不说别的，单就一个“双曲面全景玻璃车顶”就已经让汽车设计界奉为经典。</div><p><br/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/aE7gE99cV7Xv71lC98XCEc57667r8v.jpg\" width=\"100%\" alt=\"images/1/2017/11/aE7gE99cV7Xv71lC98XCEc57667r8v.jpg\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">经典低重心跑车车身设计</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">标致RCZ整车设计属于典型的跑车风格，低矮的车身降低了车身重心，在赛道中有着极高的车身稳定性。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/IXBEbB4tgTO4AUt5B8a68446zZBPZB.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/DxAAg2xegKEGT2ccmx2Pq2ZocCuMIm.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/rQPXOwEPXpxf84wOE8WH6FWhQfq5th.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/CnNNkL50dP7aKL5APLzDyhUAausUAv.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/LjdYYGavyyMYWHkVfGxAPiMFiDt0Hj.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">赛车式座椅和方向盘</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">标致RCZ内饰采用简洁风格，没有过多复杂的线条，也没有过多的高技术配置植入，唯有握感舒适的赛车式方向盘和镀铬脚踏板能唤起驾驶者的荷尔蒙。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/R2l1kDnDsHezK4l9m24eknh3SiSk9l.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/W2pEjp2S0mPP3013u2ozSMRz3J2Fff.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">贴地飞行的驾驶体验</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">跑车定位的标致RCZ除了高颜值吸引眼球外，很大的特点就是较高的驾驶乐趣，跑车与普通家用车最大的不同就是那种贴地飞行的驾驶感觉。</div><p><br/></p>', '', '', '0.00', '0.00', '0.00', '0.00', '3.28', '5298', '12', '20.94', '7259.00', '36', '32.88', '3000.00', '3', '0', '6', '0', '', '1510118307', '0.00', '', '0', '0', '0', '0', 'a:3:{i:1;s:51:\"images/1/2017/11/ONrg7R2q8bO8iI1Rc75FIiKiB7NzZI.jpg\";i:2;s:51:\"images/1/2017/11/ZOhg3H2mF36Vm8fAgz2e9h312abVMZ.jpg\";i:3;s:51:\"images/1/2017/11/Vqq1q9xkV09xGg0JGMjvk9jvxko9P0.jpg\";}', '1', '1', '0', '1', '1', '0', '0', '0', '0', '2', '0', '1', '0.00', '500.00', '0.00', '2000.00', '0.00', '1000.00', '0.00', '', '', '', '0', '', '', '0', '', '1', '', '', '', '', '2', '6,7,8', '', '0', '', '0', '', '', '0.00', '0', '1177', '{\"type\":\"0\",\"default\":\"\",\"default_pay\":\"\"}', '0', '0', '', '1185', '1177,1185', '0', '', '', '', '', '', '', '', '0', '0.00', '0', '0.00', '', '0', '0', '0', '0', '0', '0.00', '0', '2014款 标致RCZ 1.6T 时尚型', '', '1510117800', '{\"type\":0,\"default\":{\"option0\":\"\"}}', '{\"type\":0,\"default\":{\"option0\":[\"\",\"\",\"\"]},\"level3\":{\"option0\":[\"\",\"\",\"\"]},\"level4\":{\"option0\":[\"\",\"\",\"\"]},\"level5\":{\"option0\":[\"\",\"\",\"\"]}}', '0', '0', null, '0', '1', '1', '0', '', '0.00', '0.00', '请选择省份', '请选择城市', '0', '', '0', '0', '', '0', null, '0', '0', '1', '0', '0', '外观新月白+内饰棕色', '0', '0', null, '0', '0', '0', '1', '0', '标致', '', '', '', '0', 'null', '0', '0', '0', '0', '0', '0.00', '0', '0', '0', null, '0', '0', '0', '0', '0', '0', '1510117800', '0', '0', '0.00');
