INSERT INTO `ims_ewei_shop_goods` VALUES ('227', '1', '1174', '1177', '1', '0', '0', '别克英朗', 'images/1/2017/11/VuuUZTSLLKKsfzaosO66Zduk114FIF.jpg', '', '', '<p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/fz56Fj2u2gkgTF4ff00UjjKJ5jfaBF.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/uHD1ueUmf2KceA2mF5d2C5z2SC12UC.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">全新英朗定位于高品质家用车</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">2015年换代后的英朗我们称之为全新英朗，全新英朗的定位已经和上一代英朗发生了重大变化，上一代英朗注重体验车辆的驾驶操控性，而全新英朗定位于一款高品质家用轿车，所以全新英朗只推出三厢款，以满足多口之家的日常通勤代步为主要目的。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/HNA0BHiHcYqNnbMJ447ascnHa47z84.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/kVfnAA8g860j8pIdSIDa55986Jj95I.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">年轻并时尚的外观造型</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">全新英朗整体贯穿了年轻时尚的设计理念，已经不见英朗GT的影子，不过不可否认的是，我们依旧可以称之为“小君越”，不论进气格栅还是侧面跳跃的腰线，都与君越如出一辙，有着相当不错的视觉感受。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/eV9VMzcmSO39oZAoqMruSUQoOVC9cm.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/EG5EXz7ARk6B7PB5xbuaB7rkAqX176.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/ji9hxPRHX9U9AKwI0aRHZ6pHHihAX9.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/grHqq0MYZsWjj0Q4DYS5J5rmyRmQrF.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">豪华且舒适的内饰设计</div><p style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">中控台造型采用了全新的“漂浮”式设计，再加上别克一直注重营造的360度环绕式座舱，整体内饰衬托出一种强烈的未来科技感。作为一款定位于家用的车型，车内各种储物空间是必不可少的，全新英朗在这方面做的特别到位，有非常可观的储物空间可用。</p><p style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\"><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/K0s5eT3cu0ZSkw3n2K2LeKZs3E8UEu.jpg\" width=\"100%\" alt=\"images/1/2017/11/K0s5eT3cu0ZSkw3n2K2LeKZs3E8UEu.jpg\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">经济更实用的动力系统</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">既然作为一款家用车，那么动力的配置就不是那么重要了，上海通用也没有在动力匹配上花费过多经历，匹配了目前在通用多款车型上都搭载的1.5L+6AT的动力组合，这套系统以动力输出稳定为主，同时兼具经济性，百公里平均油耗仅为6升的水平。</div><p><br/></p>', '', '', '0.00', '1000.00', '0.00', '0.00', '1.26', '1798', '12', '9.39', '3255.00', '36', '12.69', '3000.00', '3', '0', '1', '0', '', '1510119798', '0.00', '', '0', '0', '0', '0', 'a:3:{i:1;s:51:\"images/1/2017/11/hgYv4OGBzU26g2uUU4GbO2dbd677uD.jpg\";i:2;s:51:\"images/1/2017/11/aj453ZirorHWh664It3DiCV5ttnenn.jpg\";i:3;s:51:\"images/1/2017/11/Hkstg4mD8TS4Dm8db8S0m4m6sKh8hg.jpg\";}', '1', '1', '0', '1', '1', '0', '0', '0', '0', '2', '0', '1', '0.00', '500.00', '0.00', '2000.00', '0.00', '1000.00', '0.00', '', '', '', '0', '', '', '0', '', '1', '', '', '', '', '2', '6,7,8', '', '0', '', '0', '', '', '0.00', '0', '1177', '{\"type\":\"0\",\"default\":\"\",\"default_pay\":\"\"}', '0', '0', '', '1183', '1177,1183', '0', '', '', '', '', '', '', '', '0', '0.00', '0', '0.00', '', '0', '0', '0', '0', '0', '0.00', '0', '2017款 英朗 15N 自动精英型', '', '1510119480', '{\"type\":0,\"default\":{\"option0\":\"\"}}', '{\"type\":0,\"default\":{\"option0\":[\"\",\"\",\"\"]},\"level3\":{\"option0\":[\"\",\"\",\"\"]},\"level4\":{\"option0\":[\"\",\"\",\"\"]},\"level5\":{\"option0\":[\"\",\"\",\"\"]}}', '0', '0', null, '0', '1', '1', '0', '', '1000.00', '1000.00', '请选择省份', '请选择城市', '0', '', '0', '0', '', '0', null, '0', '0', '1', '0', '0', '外观雪域白+内饰灰色', '0', '0', null, '0', '0', '0', '1', '0', '别克', '', '', '', '0', 'null', '0', '0', '0', '0', '0', '0.00', '0', '0', '0', null, '0', '0', '0', '0', '0', '0', '1510119480', '0', '0', '0.00');
INSERT INTO `ims_ewei_shop_goods` VALUES ('235', '1', '1174', '1177', '1', '0', '0', '大众途安L', 'images/1/2017/11/EHbGL1bNQDNRxnIqFRGFnT1RBTHnYn.jpg', '', '', '<p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/Ivv2zt8SVziP50yYaz7PSS42SAI62T.jpg\" width=\"100%\" alt=\"images/1/2017/11/Ivv2zt8SVziP50yYaz7PSS42SAI62T.jpg\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">轴距相比老款增加113mm</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">全新途安L整体设计相比老款车型焕然一新，大众集团最新的设计风格，简约、硬朗、经久耐看，车身尺寸相比上一代车型全面增长，轴距增长113mm，让途安L的空间表现更具竞争力。侧面线条比上一代车型更硬朗、年轻，A柱更加倾斜，降低了风阻系数，提高了碰撞安全性，一举两得。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/epcrRVvcx8t3wOaOrQPxZaXpJjojZk.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/P6J66F078zpe71uuP4GDSKHzdG6K8d.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/t9hj4eE48r1D18m6T4Q7m1XB71T841.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">轴距相比老款增加113mm</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" backgrou