INSERT INTO `ims_ewei_shop_goods` VALUES ('230', '1', '1174', '1177', '1', '0', '0', '别克君威', 'images/1/2017/11/GtIcKH498wE4C9H9lEx8IhIwE6t4lx.jpg', '', '', '<p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/XswCESp6o6EnNNEE7NxzB67b9wONhb.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/tf6f0h43LY6lJ3iZ4J62yOL33pI6yo.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/irH117QCXXpXPM3FU3YF1QHOH7II57.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">君威颠覆了国人对美系车的认知</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">君威的前身别克世纪是上海通用引入中国的第一款车，作为典型的美系车，大气的外观长时间作为国人选车的基准，随着2008年君威换代，君威的到来颠覆了我们对美系车的一贯认知，优雅动感的车身造型替代“以大为美”的外观再次颠覆了我们对美系车的一贯认知。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/bHZTTMJkkAtjDvm7MZA6H1bTVDdJYd.jpg\" width=\"100%\" alt=\"images/1/2017/11/bHZTTMJkkAtjDvm7MZA6H1bTVDdJYd.jpg\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">优雅动感外观造型更适合国人审美</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">新君威在车身设计上已经彻底抛弃了美系车的基因，基本沿袭了通用欧洲的设计风格，整车外形以内敛运动为主，也很符合中国传统的“内敛”美。在细节设计上，充分体现出君威的运动基因，尾灯设计上更扁平化，连接左右尾灯的镀铬条延伸到车灯内部，更具动感效果。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/PIqQ8DtUtqQT822jkszU7YkSyTWd84.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/F97gH9HZtg7GZgT11g5l77m7S1Rl1m.jpg\" width=\"100%\" alt=\"images/1/2017/11/F97gH9HZtg7GZgT11g5l77m7S1Rl1m.jpg\"/><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/A5PphjQQcHzQJQWCUah93hz96wcL3a.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/QbXR24wxMw602PBY06Y3S6Rx0yw6ls.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/oamZ3e7a2zN3Z3M2iN9q7d9M33A01A.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">“环抱式”中控设计激发驾驶欲望</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">新君威采用别克引以为傲的“环抱式”中控台造型，一条半圆形装饰条将中控台、左前门、右前门围合围起来，形成一切以驾驶者为核心的视觉氛围，颇有战斗机驾驶舱的架势。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/zB5i5N5WrZcp12SPrrcYGkEc5ybSPs.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/lk25Hh84poY08x40xvVbzlk8Pk8BC0.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">动力系统采用1.6T+6AT经典组合</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">新君威搭载1.6T涡轮增压引擎，最大输出功率高达135千瓦，最大扭矩输出235牛米，已经超过了大多数同排量涡轮引擎的动力表现，作为一款主打运动概念的家用车，这样的动力配置已经够用。</div><p><br/></p>', '', '', '0.00', '2000.00', '0.00', '0.00', '1.89', '2798', '12', '13.99', '4850.00', '36', '18.99', '3000.00', '2', '0', '4', '0', '', '1510120766', '0.00', '', '0', '0', '0', '0', 'a:2:{i:1;s:51:\"images/1/2017/11/z23NI36Q3uCr8Qu6g0M5K5noq5Kk8J.jpg\";i:2;s:51:\"images/1/2017/11/PF6yFZtEPkG3p3Fp5Xyz56s2ox5tZx.jpg\";}', '1', '1', '0', '1', '1', '0', '0', '0', '0', '1', '0', '1', '0.00', '500.00', '0.00', '2000.00', '0.00', '1000.00', '0.00', '', '', '', '0', '', '', '0', '', '1', '', '', '', '', '1', '6,7,8', '', '0', '', '0', '', '', '0.00', '0', '1177', '{\"type\":\"0\",\"default\":\"\",\"default_pay\":\"\"}', '0', '0', '', '1183', '1177,1183', '0', '', '', '', '', '', '', '', '0', '0.00', '0', '0.00', '', '0', '0', '0', '0', '0', '0.00', '0', '2015款 君威 1.6T 领先技术型', '', '1510120440', '{\"type\":0,\"default\":{\"option0\":\"\"}}', '{\"type\":0,\"default\":{\"option0\":[\"\",\"\",\"\"]},\"level3\":{\"option0\":[\"\",\"\",\"\"]},\"level4\":{\"option0\":[\"\",\"\",\"\"]},\"level5\":{\"option0\":[\"\",\"\",\"\"]}}', '0', '0', null, '0', '1', '1', '0', '', '2000.00', '2000.00', '请选择省份', '请选择城市', '0', '', '0', '0', '', '0', null, '0', '0', '1', '0', '0', '外观幻白+内饰黑色', '0', '0', null, '0', '0', '0', '1', '0', '别克', '', '', '', '0', 'null', '0', '0', '0', '0', '0', '0.00', '0', '0', '0', null, '0', '0', '0', '0', '0', '0', '1510120440', '0', '0', '0.00');
INSERT INTO `ims_ewei_shop_goods` VALUES ('231', '1', '1174', '1177', '1', '0', '0', '别克君越', 'images/1/2017/11/Owt95X22kEwkXAzjL3ll9keeXAAKZj.jpg', '', '', '<p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/ZwV0Svxlr5wCKZ0VC0kawWkv95J0Av.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/nIIzEsisgR072c2uUHv72522S2ZIeU.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/BhQTpG02421g1kM7G6w31yKtRHW7rw.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">更高燃效比的混动引擎更适合国人</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">作为一贯喜好大排量的美系车，在如今各大厂商以燃效比竞相争逐的今天，别克君越也推出了它的混动车型加入了这场“群雄逐鹿”，让选择这类车型的消费者能够更加轻松的应对各种商务场合。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/QlEBg2XHHkzzieGEqSssIbQ7e376T6.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/cPrWDcfpMzz9C8WuIi1h9HI9H1urtM.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">混动版外观加入明显的环保蓝元素</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">君越30H精英版相比普通版只在车尾细节处增加了混动HEV的蓝色标识，车头的别克盾标包裹的一圈蓝色装饰，暗示着大家它身上科技光环满满的混动系统。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/x61o3606DnvZdz619d0qq3Dv0h3qS0.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/Fnm58MeuRIWW8TFmEGsm5sRi5r5RUU.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/SOOenlV8tJeo8uyTjlJclTtNYfoL8l.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/KqVjX22525Y2hj92V2QabH2HFvNPJJ.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">内饰凸显豪华商务氛围堪比C级车</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">不夸张的说，君越的内饰氛围在同级别的混动车型中处于越级水准，枫木木纹饰条配合镀铬装饰，加上双缝线的真皮包边，可以说已经接近豪华品牌的内饰水平。</div><p><br/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/w3kL4ej424LEz2M3Yl3lJZGg07003Y.jpg\" width=\"100%\" alt=\"images/1/2017/11/w3kL4ej424LEz2M3Yl3lJZGg07003Y.jpg\"/><br/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">搭载创新混动引擎燃效比更高更节能</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">君越30H精英版搭载了一台128匹马力的1.8L自然吸气发动机，配合了一台155匹马力的电动机，工信部百公里油耗低至4.7L，当需要加速超车的时候，电机的动力会及时地爆发出来，百公里加速可达到8.9s。</div><p><br/></p>', '', '', '0.00', '2000.00', '0.00', '0.00', '2.75', '4698', '12', '21.25', '7366.00', '36', '27.58', '3000.00', '2', '0', '5', '0', '', '1510122030', '0.00', '', '0', '0', '0', '0', 'a:3:{i:1;s:51:\"images/1/2017/11/pG0zwZkMw0g6l6262L2T1liZ6TGz32.jpg\";i:2;s:51:\"images/1/2017/11/z2dbjbVChjLS1mjHAm3biVbhDd31Bl.jpg\";i:3;s:51:\"images/1/2017/11/qUgv1YfF55FB1wVr35gB11Gbnv1wru.jpg\";}', '1', '1', '0', '1', '1', '0', '0', '0', '0', '2', '0', '1', '0.00', '500.00', '0.00', '2000.00', '0.00', '1000.00', '0.00', '', '', '', '0', '', '', '0', '', '1', '', '', '', '', '1', '6,7,8', '', '0', '', '0', '', '', '0.00', '0', '1177', '{\"type\":\"0\",\"default\":\"\",\"default_pay\":\"\"}', '0', '0', '', '1183', '1177,1183', '0', '', '', '', '', '', '', '', '0', '0.00', '0', '0.00', '', '0', '0', '0', '0', '0', '0.00', '0', '2016款 君越 30H 精英型（混动版）', '', '1510121760', '{\"type\":0,\"default\":{\"option0\":\"\"}}', '{\"type\":0,\"default\":{\"option0\":[\"\",\"\",\"\"]},\"level3\":{\"option0\":[\"\",\"\",\"\"]},\"level4\":{\"option0\":[\"\",\"\",\"\"]},\"level5\":{\"option0\":[\"\",\"\",\"\"]}}', '0', '0', null, '0', '1', '1', '0', '', '2000.00', '2000.00', '请选择省份', '请选择城市', '0', '', '0', '0', '', '0', null, '0', '0', '1', '0', '0', '外观象牙白+内饰浅色/外观墨玉黑+内饰浅色', '0', '0', null, '0', '0', '0', '1', '0', '别克', '', '', '', '0', 'null', '0', '0', '0', '0', '0', '0.00', '0', '0', '0', null, '0', '0', '0', '0', '0', '0', '1510121760', '0', '0', '0.00');
INSERT INTO `ims_ewei_shop_goods` VALUES ('232', '1', '1174', '1177', '1', '0', '0', '别克昂科拉', 'images/1/2017/11/eBn1W6sRsSOEr71e176sAsMsSwM9Fs.jpg', '', '', '<p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/jX0X7zIg0Xpz00GC9iFfKlacCeI7L7.jpg\" width=\"100%\" alt=\"images/1/2017/11/jX0X7zIg0Xpz00GC9iFfKlacCeI7L7.jpg\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">专为年轻人打造的入门级SUV座驾</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">昂科拉作为一款标准小型SUV车型，目标客户群人多是刚毕业年轻用户，在选择座驾时，对车辆的时尚、运动特性往往有着特殊要求，必须和自我标榜的个性一致。因此，昂科拉无论是外观、还是内饰的细节设计上，无时无刻不透露出对时尚与运动特性的最新诠释。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/xmGfAGeRlyYCFM04oiHLizmGpmRcFu.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/BWsgYyiKYG5TnGYnDnndyDe9ttKNdt.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">外观延续海外版设计理念</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">新款昂科拉延续了海外版的设计，全新的家族式进气格栅让新车车头看起来更加时尚。在侧面，这款车采用了全新的17英寸轮圈，车顶行李架的造型也十分动感。从车身尾部来看，昂科拉设计带有强烈的运动风格，比如车尾有一个明显的倾斜，提升了车身视觉上的运动效</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/tfy54zZo5Na5AF0fAZBAzA4rSk0EeD.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/NeA61ggH3B3033eaD5D1zyJ6HbB06d.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/Z2nuPt94sYY0yP7sPy4ppK90QS2270.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/DtA7ALd58BDbtAahFjdAF5FFDeJez4.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\"><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">内饰设计沿袭别克家族风格</div><p style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">新款昂科拉的内饰设计同样沿袭了别克全新的风格，中控台线条十分流畅，整体来看要比现款车型更加大气。虽然昂科拉外观追求时尚与个性，但是在内饰设计中，昂科拉却保守了许多，中控造型比较传统，但是制造工艺和内饰材质却有着很高的水平。</p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/fz8Zhn656UXG6xx5Wu07ATG580L4LH.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/Lw46K0C5534X3c0s30F3fXBs3AA563.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/vP4P2N9nxlSLRhGkCMhkgPK9m6Yk14.jpg\" width=\"100%\" style=\"\"/></p><p style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\"><br/></p></div><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">配置丰富更加注重日常使用</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">新款昂科拉全系标配发动机自动启停、电动天窗、LED日间行车灯、多功能方向盘、倒车雷达、后视镜加热等配置，充分考虑了日常驾驶上的便利性。同时搭载的1.4T+6速手自一体变速箱，涡轮增压发动机的低速高扭的动力输出特性也十分适合城市拥堵路况。</div><p><br/></p>', '', '', '0.00', '2000.00', '0.00', '0.00', '1.49', '1998', '12', '11.16', '3869.00', '36', '14.99', '3000.00', '6', '0', '8', '0', '', '1510122315', '0.00', '', '0', '0', '0', '0', 'a:3:{i:1;s:51:\"images/1/2017/11/bWFA0SZbf04wW80aGOwbWbGZBFAabn.jpg\";i:2;s:51:\"images/1/2017/11/o23x5PxzRqpe3dfYbbQCq3FERpFcSk.jpg\";i:3;s:51:\"images/1/2017/11/KL9SGL9Nl3snJS7G7NGLssn7jz7v9L.jpg\";}', '1', '1', '0', '1', '1', '0', '0', '0', '0', '1', '0', '1', '0.00', '500.00', '0.00', '2000.00', '0.00', '1000.00', '0.00', '', '', '', '0', '', '', '0', '', '1', '', '', '', '', '2', '6,7,8', '', '0', '', '0', '', '', '0.00', '0', '1177', '{\"type\":\"0\",\"default\":\"\",\"default_pay\":\"\"}', '0', '0', '', '1183', '1177,1183', '0', '', '', '', '', '', '', '', '0', '0.00', '0', '0.00', '', '0', '0', '0', '0', '0', '0.00', '0', '2017款 昂科拉 18T 自动两驱 领先型', '', '1510122060', '{\"type\":0,\"default\":{\"option0\":\"\"}}', '{\"type\":0,\"default\":{\"option0\":[\"\",\"\",\"\"]},\"level3\":{\"option0\":[\"\",\"\",\"\"]},\"level4\":{\"option0\":[\"\",\"\",\"\"]},\"level5\":{\"option0\":[\"\",\"\",\"\"]}}', '0', '0', null, '0', '1', '1', '0', '', '2000.00', '2000.00', '请选择省份', '请选择城市', '0', '', '0', '0', '', '0', null, '0', '0', '1', '0', '0', '外观雪域白+内饰黑色', '0', '0', null, '0', '0', '0', '1', '0', '别克', '', '', '', '0', 'null', '0', '0', '0', '0', '0', '0.00', '0', '0', '0', null, '0', '0', '0', '0', '0', '0', '1510122060', '0', '0', '0.00');
INSERT INTO `ims_ewei_shop_goods` VALUES ('233', '1', '1174', '1177', '1', '0', '0', '别克GL8', 'images/1/2017/11/CEDHw7JdXx9dx9964eEdC60kEMh7W6.jpg', '', '', '<p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/sjjrj9bjbo2pAuFU97oqHOvZ06279w.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/M3753a7Qz3aqyy3rw7h25r7RAcg36A.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">在中国，别克GL8几乎是商务车的代名词</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">在中国，如果能将一个汽车细分市场与一个车型关联起来，恐怕只有一款车型能担当此任，那就是别克GL8，在国内别克GL8几乎是商务车的别称。能做到如此成功除了出道早之外，与别克GL8过硬的汽车品质也是分不开的。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/ZRzVjUN9mRhrrLcddrfQQFdDZqqrdf.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/pWoVG9E99Wf1ebk0qev9gzu9wT0tp1.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">低调、沉稳的外观造型一直都是GL8的主旋律</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">对于一款商务车来说，低调沉稳的外观造型就十分重要，别克GL8无论是这一代，还是之前的几代车型，沉稳的车身造型一直都是GL8的主旋律。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/b39XD2TX24ZX4yT2unUii4Y3oTNN4l.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/Xv04lT0Ll141l08poVVOn1l3vw1J03.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">乘坐舒适才是别克GL8的重中之重</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">对于商务车来说，外观一直都不是要表达的重点，车内驾乘的舒适性才是商务车的重中之重，对于别克GL8来说，这方面无疑做的很棒，否则也不会有今天的商务车“一哥”的地位。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/eE6X6G3RJf6Eu6I6fyYUgCxyFLEL6Y.jpg\" width=\"100%\" style=\"\"/><br/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/XGFzOoDPWoJxfw1X821j2s1xo1OwPW.jpg\" width=\"100%\" style=\"\"/></p><p><br/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">提供丰富的配置只为车内乘客旅途更爽</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">别克GL8非常注重为车内人员提供优秀的服务和体验，例如全自动空调且后排带有出风口，无论是酷暑还是寒冬都能为车内乘员提供舒适的车内环境；还有后排的隐私玻璃为车内乘客提供很好的保护；此外，前后双天窗的配备也为车内人员提供了更多旅途看风景的机会。</div><p><br/></p>', '', '', '0.00', '2000.00', '0.00', '0.00', '2.49', '6598', '12', '19.99', '6930.00', '36', '24.99', '3000.00', '5', '0', '9', '0', '', '1510122570', '0.00', '', '0', '0', '0', '0', 'a:3:{i:1;s:51:\"images/1/2017/11/O7b902wez92Niw7b7loXW5WbOLBXe9.jpg\";i:2;s:51:\"images/1/2017/11/i6km0Q8KzICQQzUkguE084E4i8SZ64.jpg\";i:3;s:51:\"images/1/2017/11/RYe4944SDs4Tb9990bLjtKs96JkB60.jpg\";}', '1', '1', '0', '1', '1', '0', '0', '0', '0', '6', '0', '1', '0.00', '500.00', '0.00', '2000.00', '0.00', '1000.00', '0.00', '', '', '', '0', '', '', '0', '', '1', '', '', '', '', '2', '6,7,8', '', '0', '', '0', '', '', '0.00', '0', '1177', '{\"type\":\"0\",\"default\":\"\",\"default_pay\":\"\"}', '0', '0', '', '1183', '1177,1183', '0', '', '', '', '', '', '', '', '0', '0.00', '0', '0.00', '', '0', '0', '0', '0', '0', '0.00', '0', '2017款 别克GL8 25S 豪华型', '', '1510122300', '{\"type\":0,\"default\":{\"option0\":\"\"}}', '{\"type\":0,\"default\":{\"option0\":[\"\",\"\",\"\"]},\"level3\":{\"option0\":[\"\",\"\",\"\"]},\"level4\":{\"option0\":[\"\",\"\",\"\"]},\"level5\":{\"option0\":[\"\",\"\",\"\"]}}', '0', '0', null, '0', '1', '1', '0', '', '2000.00', '2000.00', '请选择省份', '请选择城市', '0', '', '0', '0', '', '0', null, '0', '0', '1', '0', '0', '外观琥珀金+内饰米色', '0', '0', null, '0', '0', '0', '1', '0', '别克', '', '', '', '0', 'null', '0', '0', '0', '0', '0', '0.00', '0', '0', '0', null, '0', '0', '0', '0', '0', '0', '1510122300', '0', '0', '0.00');
INSERT INTO `ims_ewei_shop_goods` VALUES ('236', '1', '1174', '1177', '1', '0', '0', '大众 POLO', 'images/1/2017/11/ClTtnAlCDN5xFtAFNB0u3lCdcPXl51.jpg', '', '', '<p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/Pk6FJZdQfB7PfPDrx8pxQfbNjzq3E5.jpg\" width=\"787\" alt=\"images/1/2017/11/Pk6FJZdQfB7PfPDrx8pxQfbNjzq3E5.jpg\" height=\"477\" style=\"width: 787px; height: 477px;\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">小型车里的颜值冠军</div><p style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">POLO的上市时间确实不短了，不过外形还是那么养眼。完美的比例，年轻的造型，真的算是小型车里的颜值冠军了。尤其适合刚刚毕业预算不多的年轻人，开这台车，泡妞也是妥妥的。</p><p style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\"><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/eTrBtMCZr0tt90C4F4T6LLMiB0M00I.jpg\" width=\"100%\" alt=\"images/1/2017/11/eTrBtMCZr0tt90C4F4T6LLMiB0M00I.jpg\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">POLO代表的运动基因</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">上海大众车队之前参加CTCC的赛车就是POLO，当然，赛车肯定是经过了很多的改装。不过就像女生一样，有个好底子才能化妆出来，POLO的底子就不差，再稍微“化化妆”，好操控就出来</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/K5154k03JJu3Iuddjjjd0JTiJKKV0M.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/gC53t7zGT337kTCk3Otkj53cuOOkuy.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/XEo11mIETEKOoc2lH5O2IocET2KcNG.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">安全配置一点没省</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">POLO在主动安全配置上一点都没有省钱。全系标配后视镜加热、后雨刷、方向盘四向调节、座椅高低调节。保证你调节到最合适的驾驶姿势，有着最完美的驾驶视野。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/LwDKSjrkf278Si4Jwzd2843dsZiWGh.jpg\" width=\"100%\" alt=\"images/1/2017/11/LwDKSjrkf278Si4Jwzd2843dsZiWGh.jpg\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">1.4L自然吸气+6速自动变速器，皮实耐用</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">这套动力总成完美继承了老大众的皮实耐用称号，只要按时维护，绝对不会半路掉链子。当然动力确实一般，不过只要舍得踩，还是有点小激情的。</div><p><br/></p>', '', '', '0.00', '1000.00', '0.00', '0.00', '0.87', '1998', '12', '6.59', '2284.00', '36', '8.79', '3000.00', '7', '0', '6', '0', '', '1510123583', '0.00', '', '0', '0', '0', '0', 'a:2:{i:1;s:51:\"images/1/2017/11/vb5yKjeU3WguLdGD0pKg33G3IKJBPy.jpg\";i:2;s:51:\"images/1/2017/11/WjFDIyYxiJfBYWox0jBJFFyfVjYoJJ.jpg\";}', '1', '1', '0', '1', '1', '0', '0', '0', '0', '2', '0', '1', '0.00', '500.00', '0.00', '2000.00', '0.00', '1000.00', '0.00', '', '', '', '0', '', '', '0', '', '1', '', '', '', '', '1', '6,7,8', '', '0', '', '0', '', '', '0.00', '0', '1177', '{\"type\":\"0\",\"default\":\"\",\"default_pay\":\"\"}', '0', '0', '', '1182', '1177,1182', '0', '', '', '', '', '', '', '', '0', '0.00', '0', '0.00', '', '0', '0', '0', '0', '0', '0.00', '0', '2016款 POLO 1.4L 自动风尚型', '', '1510123260', '{\"type\":0,\"default\":{\"option0\":\"\"}}', '{\"type\":0,\"default\":{\"option0\":[\"\",\"\",\"\"]},\"level3\":{\"option0\":[\"\",\"\",\"\"]},\"level4\":{\"option0\":[\"\",\"\",\"\"]},\"level5\":{\"option0\":[\"\",\"\",\"\"]}}', '0', '0', null, '0', '1', '1', '0', '', '1000.00', '1000.00', '请选择省份', '请选择城市', '0', '', '0', '0', '', '0', null, '0', '0', '1', '0', '0', '外观白色+内饰黑色', '0', '0', null, '0', '0', '0', '1', '0', '大众', '', '', '', '0', 'null', '0', '0', '0', '0', '0', '0.00', '0', '0', '0', null, '0', '0', '0', '0', '0', '0', '1510123260', '0', '0', '0.00');
INSERT INTO `ims_ewei_shop_goods` VALUES ('237', '1', '1174', '1177', '1', '0', '0', '大众宝来', 'images/1/2017/11/QcYMfO1jqs3Q6vHYMcTYSey7c26VJy.jpg', '', '', '<p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/a991awhyAMY9249y4YIpyy6wAYm4wM.jpg\" width=\"100%\" alt=\"images/1/2017/11/a991awhyAMY9249y4YIpyy6wAYm4wM.jpg\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">家喻户晓的家用车</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">宝来算是中国具有传奇色彩的一款车型，从2001款初次引入国内，到目前已经历了三次换代，从最早“驾驶者之车”的定位，到“家用车首选车型”的转变，已经成为国内销量排名前三位的车型，2016年销量高达22万辆，可谓是家喻户晓。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/RXJeSz2zBN0mbBEeiQJAoeZSSzayqs.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/uxzyVdVXjYn9vzmv2WWmeHHu383u3H.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/bNXCqd71lzd0L7xCLLLZ0Nw91ncT1x.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/dwwudSeH66Ee0w6EeVeZo7aAhsHwWY.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">内饰还是很大众</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">从内饰角度来看，全新宝来还是那么“大众味道”十足，标志性的大众中控台设计和大众旗下其它几款车十分神似。从设计的角度上来讲，外观追求个性化，内饰追求实用化是不变的道理，实用的内饰设计更容易吸引那些已经习惯了大众汽车内饰风格的“大众粉”。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/obk4PAbC2E2e5Rlb5XASRXE2E4xhbI.jpg\" width=\"773\" alt=\"images/1/2017/11/obk4PAbC2E2e5Rlb5XASRXE2E4xhbI.jpg\" height=\"571\" style=\"width: 773px; height: 571px;\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">内饰还是很大众</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">从内饰角度来看，全新宝来还是那么“大众味道”十足，标志性的大众中控台设计和大众旗下其它几款车十分神似。从设计的角度上来讲，外观追求个性化，内饰追求实用化是不变的道理，实用的内饰设计更容易吸引那些已经习惯了大众汽车内饰风格的“大众粉”。</div><p><br/></p>', '', '', '0.00', '1000.00', '0.00', '0.00', '1.31', '2898', '12', '9.99', '3463.00', '36', '13.18', '3000.00', '8', '0', '4', '0', '', '1510123849', '0.00', '', '0', '0', '0', '0', 'a:4:{i:1;s:51:\"images/1/2017/11/mUnFjNZn0Q0N7YNJA07FNG8ZE3Mufe.jpg\";i:2;s:51:\"images/1/2017/11/YhSxvDnEZK933smQDRkfQdF66411tK.jpg\";i:3;s:51:\"images/1/2017/11/al1gRg3TKHy8e0k1tLe8SRltW1L1wr.jpg\";i:4;s:51:\"images/1/2017/11/RwtCC4927eA2a2ec7V9TR9e5y7AAC4.jpg\";}', '1', '1', '0', '1', '1', '0', '0', '0', '0', '3', '0', '1', '0.00', '500.00', '0.00', '2000.00', '0.00', '1000.00', '0.00', '', '', '', '0', '', '', '0', '', '1', '', '', '', '', '2', '6,7,8', '', '0', '', '0', '', '', '0.00', '0', '1177', '{\"type\":\"0\",\"default\":\"\",\"default_pay\":\"\"}', '0', '0', '', '1182', '1177,1182', '0', '', '', '', '', '', '', '', '0', '0.00', '0', '0.00', '', '0', '0', '0', '0', '0', '0.00', '0', '2018款 宝来 1.5L 自动舒适型', '', '1510123560', '{\"type\":0,\"default\":{\"option0\":\"\"}}', '{\"type\":0,\"default\":{\"option0\":[\"\",\"\",\"\"]},\"level3\":{\"option0\":[\"\",\"\",\"\"]},\"level4\":{\"option0\":[\"\",\"\",\"\"]},\"level5\":{\"option0\":[\"\",\"\",\"\"]}}', '0', '0', null, '0', '1', '1', '0', '', '1000.00', '1000.00', '请选择省份', '请选择城市', '0', '', '0', '0', '', '0', null, '0', '0', '1', '0', '0', '外观极地白+内饰黑色', '0', '0', null, '0', '0', '0', '1', '0', '大众', '', '', '', '0', 'null', '0', '0', '0', '0', '0', '0.00', '0', '0', '0', null, '0', '0', '0', '0', '0', '0', '1510123560', '0', '0', '0.00');
INSERT INTO `ims_ewei_shop_goods` VALUES ('238', '1', '1174', '1177', '1', '0', '0', '大众速腾', 'images/1/2017/11/WPKJ8CcUK34jy2DsK9DK3jkd6s8kRk.jpg', '', '', '<p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/l5hno9voPNEm29ho42AOVxATe225Hi.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/H8ruYC1eZ1eOhujN8YXMEd5hseHM5X.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">国内A级车市场的标杆车型</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">速腾作为大众家族中正统的A级车，在国内上市初期获得了巨大关注度，只是随后因为不符合国情而失利。不过随后在2012年的改款获得巨大成功，重新回到国内年度销量榜前十，速腾同时也获得了国内A级车标杆车型的地位，二手车保值率基本位列A级车NO1。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/pmUqN3nEetIfq47XN3Gz3374eUgHoo.jpg\" width=\"100%\" style=\"\"/><br/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\"><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">大众经典三厢车造型</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">速腾作为大众血统的一款“根正苗红”的A级车，速腾的众多外观设计元素后来也陆续被移植到了大众系其它A级车上，扁平化的前进气格栅甚至成为大众众多车型上的标配，现在看或许感觉速腾没什么新鲜可言，但速腾正是开创大众汽车家族化车身设计的鼻祖。</div></div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/Q4WUn7u0vfozNvNqQiZ0XR80LV45q8.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/O6X8R44Z4VRSXJr8S1N86mJ7zUN741.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/WVggb7OJpe7B7zO377ZB802H82zv85.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/EFFgQ8Zx8K78Q5zKq8qf02GzfFGF80.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/cHoshH8KPPcZHpY6pRcqYkHFhAm82h.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">内饰经典上手轻松</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">汽车外观是给别人看的，逼格得高。内饰是给自己用的，必须舒适。速腾内饰设计正是这种“好用”理念的忠实执行者，各种高档材质的运用和超高制造加工工艺，操作起来都非常有质感。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/VC6wvV2eWwE4WC5xcrvSVe0Ea7cWeb.jpg\" width=\"100%\" alt=\"images/1/2017/11/VC6wvV2eWwE4WC5xcrvSVe0Ea7cWeb.jpg\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">1.6升自然吸气+6速自动变速箱，靠谱</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">对于速腾来说，定位已经由“性能车”转变为“家用车”，因此动力匹配的主力就由之前的1.4T转变为1.6L，搭配的变速箱也由双离合转变为6速手自一体变速箱。整个动力匹配体现出速腾作为一款家用车追求经济实用的特点。</div><p><br/></p>', '', '', '0.00', '1000.00', '0.00', '0.00', '1.50', '3298', '12', '11.68', '4049.00', '36', '15.08', '3000.00', '3', '0', '0', '2', '', '1510124088', '0.00', '', '0', '0', '0', '0', 'a:0:{}', '1', '1', '0', '1', '1', '0', '0', '0', '0', '9', '0', '1', '0.00', '500.00', '0.00', '2000.00', '0.00', '1000.00', '0.00', '', '', '', '0', '', '', '0', '', '1', '', '', '', '', '2', '6,7,8', '', '0', '', '0', '', '', '0.00', '0', '1177', '{\"type\":\"0\",\"default\":\"\",\"default_pay\":\"\"}', '0', '0', '', '1182', '1177,1182', '0', '', '', '', '', '', '', '', '0', '0.00', '0', '0.00', '', '0', '0', '0', '0', '0', '0.00', '0', '2018款 速腾 1.6L 自动舒适型', '', '1510123860', '{\"type\":0,\"default\":{\"option0\":\"\"}}', '{\"type\":0,\"default\":{\"option0\":[\"\",\"\",\"\"]},\"level3\":{\"option0\":[\"\",\"\",\"\"]},\"level4\":{\"option0\":[\"\",\"\",\"\"]},\"level5\":{\"option0\":[\"\",\"\",\"\"]}}', '0', '0', null, '0', '1', '1', '0', '', '1000.00', '1000.00', '请选择省份', '请选择城市', '0', '', '0', '0', '', '0', null, '0', '0', '1', '0', '0', '外观极地白+内饰黑色', '0', '0', null, '0', '0', '0', '0', '0', '速腾', '', '', '', '0', 'null', '0', '0', '0', '0', '0', '0.00', '0', '0', '0', null, '0', '0', '0', '0', '0', '0', '1510123860', '0', '0', '0.00');
INSERT INTO `ims_ewei_shop_goods` VALUES ('239', '1', '1174', '1177', '1', '0', '0', '大众途观', 'images/1/2017/11/cjA5aFjfFB9FQF2fGfFQqBnmb21qqK.jpg', '', '', '<p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/pMmgJau9szURbJdrZgjdu6GL9a1lHr.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/ti9A7b7X846608903z6R8987Bb8m8r.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">紧凑SUV里的佼佼者</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">途观，紧凑SUV这个级别里的佼佼者，凭借着连续4年销量冠军，创造了SUV的加价神话，被人们戏称为“神车”。而如今这么多年过去，它是否已经廉颇老矣？此次带来的300TSI两驱丝绸之路舒适版在原有的300TSI两驱舒适版的配置上进行了提升，继续与新款途观L同堂销售。在我看来，老款途观具有着更富性价比的售价，以及不错的保值率，相信一定会是个不错的选择。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/oiFZCQ808lUdND7uu070SUg4gNF0uN.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/JJ1ljScFqBwihqsNNccqNwOqiLIblG.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">越发成熟的外观</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">途观的外观看上去沉稳简洁，虽然“纵横沙场”已有数载，但依旧十分耐看，而且长的越来越像它的大哥途锐了。进气格栅将两只大灯进行完美“连接”，这也许就是大众家族式的“稳重”感吧，不过着实挺好看的，两颗“獠牙”式的雾灯看起来有点“萌萌哒”，可别小看这一对“獠牙”，夜晚转向的时候它们能提供辅助照明，挺实用的。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/w3qC3rQDIJII1iA662i922R1IAoAa3.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/Sp70s0qlzb0XSnn2j9NQj497PXPB24.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/wbBxa2HsxOkptlSi02kloLlB6hfs2h.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/m6xZoPPQ02kupn0zQXXP8OXp2xQOzX.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/H6ysoxGSSrooNy8SYxQOM580O6N0RS.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">内饰材料有高级感</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">途观的中控台采用了大面积的软质搪塑材料包裹，搭配了银色的装饰面板，圆形的空调出风口可以调节任意角度出风，搭配双区自动空调系统，自动实用性还是很不错的，真皮座椅柔软度合适并给主驾驶座椅配备了电动调节。真皮方向盘支持多功能按键，操作便利性还是非常不错。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/s3Nrc25hGy1311qr50fRc2r3Ph0cnh.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/v7UCCaQQ7CUI7nD7e5UIqCeic8eID6.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/KU85kqKQKu9k895p5U8B5315Pk9p53.jpg\" width=\"100%\" alt=\"images/1/2017/11/KU85kqKQKu9k895p5U8B5315Pk9p53.jpg\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">经典动力系统</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">途观300TSI自动两驱丝绸之路舒适版搭载一台大家熟悉的大众EA888 1.8T涡轮增压发动机，最大马力160Ps，最大扭矩250N·m，匹配一台6速手自一体变速箱，整体调校偏向于经济型和舒适性，车辆采用了前置前驱的布局。</div><p><br/></p>', '', '', '0.00', '2000.00', '0.00', '0.00', '2.37', '4898', '12', '17.96', '6226.00', '36', '23.78', '3000.00', '8', '0', '2', '1', '', '1510124359', '0.00', '', '0', '0', '0', '0', 'a:0:{}', '1', '1', '0', '1', '1', '0', '0', '0', '0', '15', '0', '1', '0.00', '500.00', '0.00', '2000.00', '0.00', '1000.00', '0.00', '', '', '', '0', '', '', '0', '', '1', '', '', '', '', '2', '6,7,8', '', '0', '', '0', '', '', '0.00', '0', '1177', '{\"type\":\"0\",\"default\":\"\",\"default_pay\":\"\"}', '0', '0', '', '1182', '1177,1182', '0', '', '', '', '', '', '', '', '0', '0.00', '0', '0.00', '', '0', '0', '0', '0', '0', '0.00', '0', '2017款 途观 300TSI 自动两驱 舒适版', '', '1510124100', '{\"type\":0,\"default\":{\"option0\":\"\"}}', '{\"type\":0,\"default\":{\"option0\":[\"\",\"\",\"\"]},\"level3\":{\"option0\":[\"\",\"\",\"\"]},\"level4\":{\"option0\":[\"\",\"\",\"\"]},\"level5\":{\"option0\":[\"\",\"\",\"\"]}}', '0', '0', null, '0', '1', '1', '0', '', '2000.00', '2000.00', '请选择省份', '请选择城市', '0', '', '0', '0', '', '0', null, '0', '0', '1', '0', '0', '外观极光白+内饰黑色', '0', '0', null, '0', '0', '0', '1', '0', '大众', '', '', '', '0', 'null', '0', '0', '0', '0', '0', '0.00', '0', '0', '0', null, '0', '0', '0', '0', '0', '0', '1510124100', '0', '0', '0.00');
INSERT INTO `ims_ewei_shop_goods` VALUES ('240', '1', '1174', '1177', '1', '0', '0', '大众凌渡', 'images/1/2017/11/jw4wKm2KUYvkhKWKq3SwKydHmd2Mnn.jpg', '', '', '<p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/hn48uf488Ng84m3k4M41J1r3ffGjKu.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/ymG1q16Hn5X59OH11TgT1WR0q4rRRt.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/dLWeVETHSscfJfVf77R2zffRrDL22r.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">这台轿跑真的来自于大众？</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">相信每一位年轻人都有一个跑车梦，但是跑车对大多数人来说往往是可望而不可及的。那么，究竟有没有这样一款既能实现大家的梦想，售价又都在大家的承受范围内的车型呢？所以，它就出现了——上汽大众 凌渡。它轿跑的名字也不是空穴来风，因为它整车的宽高比相对普通轿车来说更加接近跑车，所以在视觉效果上会更容易给人一种很低趴的感觉，同时溜背的造型也会让它的辨识度更高，原来大众的车也能做到这么个性，点个赞！</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/vSsH64G4EsgE94e36S4ThIa62Aei68.jpg\" width=\"100%\" style=\"\"/></p><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/i1Ce1FN7fq7HcfQwWwfAOQPHwlfcno.jpg\" width=\"100%\" style=\"\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">开着有些跨级别的感觉</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">凌渡搭载的是一台EA211 1.4T低功率版发动机，搭配一台7速双离合变速箱，这是一套大众比较成熟的动力总成，虽然在低速行驶时双离合变速箱也会因为先天原因产生顿挫，但是它的优势也非常明显，换挡速度快能给你带来不错的加速体验，换挡过程中不切断扭矩的输出也会带来不错的燃油经济性。同时，凌渡采用前麦弗逊后多连杆的悬架形式，它能过滤掉大部分小颠簸，能做到这点不难，难的是它对大颠簸的处理也非常干脆，不会出现多余的弹跳，这些都为它开起来的高级感做出了贡献。</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/I93aza4QrDka1q33Q0kQio30vL9dEa.jpg\" width=\"100%\" alt=\"images/1/2017/11/I93aza4QrDka1q33Q0kQio30vL9dEa.jpg\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">手套箱是个小“冰箱”</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">夏天开车的时候是不是特别想来一罐冰镇的饮料？但如果要实现这个愿望，要么得买一台百万级的车，这好像很难实现，或者买一个外接的冰箱，但好像又没地方放！但在凌渡上，你只需要把饮料放进手套箱里，过不了多久你就能喝上冰镇的饮料了，是不是很神奇？</div><p><img src=\"http://jyqc.hejiewl.com/attachment/images/1/2017/11/UVdQg7Qq6RnGvr0a7HraZ8BENTdhB5.jpg\" width=\"100%\" alt=\"images/1/2017/11/UVdQg7Qq6RnGvr0a7HraZ8BENTdhB5.jpg\"/></p><div class=\"title\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(25, 25, 25); margin-bottom: 9px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" line-height:=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">安全配置该有的都有了</div><div class=\"desc\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.75; font-size: 12px; color: rgb(102, 102, 102); margin-bottom: 24px; padding: 0px 16px; font-family: PingFangSC-Regular, Helvetica, \" droid=\"\" white-space:=\"\" widows:=\"\" background-color:=\"\">凌渡在安全配置上可以说很良心，像ESP车身稳定系统、四气囊等同级别车型不会作为全系标配的配置它都有。安全配置可能平时不会用上，但一旦用上了就能最大限度的降低车内人员在发生事故时的损伤。同时，它还标配了自动驻车的功能，坡道起步时发生后溜可是老大难问题了，但有了自动驻车功能以后，人人都是老司机，而且平时在红绿灯的时候，不用切换档位，大胆抬起你踩着刹车的脚，它会自动帮你踩着刹车，堵车再也不会让你脚抽筋了</div><p><br/></p>', '', '', '0.00', '1000.00', '0.00', '0.00', '1.59', '2698', '12', '12.02', '4167.00', '36', '15.99', '3000.00', '56', '0', '14', '8', '', '1510124668', '0.00', '', '0', '0', '0', '0', 'a:3:{i:1;s:51:\"images/1/2017/11/cQ55S5X5JR1O4y4OtTVZ100RH1Sxyf.jpg\";i:2;s:51:\"images/1/2017/11/Y81EDc4I9E58zccR97c1i7EBb857UB.jpg\";i:3;s:51:\"images/1/2017/11/U1VVvfsRmk70G2a2RgpFK2aVL2PZmz.jpg\";}', '1', '1', '0', '1', '1', '0', '0', '0', '0', '57', '0', '1', '0.00', '500.00', '0.00', '2000.00', '0.00', '1000.00', '0.00', '', '', '', '0', '', '', '0', '', '1', '', '', '', '', '2', '6,7,8', '', '0', '', '0', '', '', '0.00', '0', '1177', '{\"type\":\"0\",\"default\":\"\",\"default_pay\":\"\"}', '0', '0', '', '1182', '1177,1182', '0', '', '', '', '', '', '', '', '0', '0.00', '0', '0.00', '', '0', '0', '0', '0', '0', '0.00', '0', '2017款 凌渡 230TSI DSG风尚版', '', '1510124340', '{\"type\":0,\"default\":{\"option0\":\"\"}}', '{\"type\":0,\"default\":{\"option0\":[\"\",\"\",\"\"]},\"level3\":{\"option0\":[\"\",\"\",\"\"]},\"level4\":{\"option0\":[\"\",\"\",\"\"]},\"level5\":{\"option0\":[\"\",\"\",\"\"]}}', '0', '0', null, '0', '1', '1', '0', '', '1000.00', '1000.00', '请选择省份', '请选择城市', '0', '', '0', '0', '', '0', null, '0', '0', '1', '0', '0', '外观凛冽白+内饰黑色', '0', '0', null, '0', '0', '0', '1', '0', '大众', '', '', '', '0', 'null', '0', '0', '0', '0', '0', '0.00', '0', '0', '0', null, '0', '0', '0', '0', '0', '0', '1510124340', '0', '0', '0.00');
